import Layout from '../components/Layout';
import Link from 'next/link';

type colorType = {
  color: {
    name: {
      value: string;
    };
  };
};

const IndexPage = ({
  color: {
    name: { value },
  },
}: colorType) => {
  console.log(value);

  return (
    <Layout>
      <div
        className="container d-flex flex-column justify-content-center align-items-center mt-4"
        style={{ height: '75vh' }}
      >
        <h1 className="title my-0">Welcome to Color View!</h1>
        <p className="desc mb-4 mt-3">What do you want to do?</p>

        <div className="btn--container">
          <Link href="/random">
            <button className="btn btn-primary mr-5">
              Get some random color
            </button>
          </Link>

          <Link href="/colorname">
            <button className="btn btn-primary">Get some color name</button>
          </Link>
        </div>
      </div>
    </Layout>
  );
};

// fetch function
export const getStaticProps = async () => {
  const res = await fetch('https://www.thecolorapi.com/id?hex=24B1E0');

  return {
    props: {
      color: await res.json(),
    },
  };
};

export default IndexPage;

